  \"2016-07-27T22:42:27.874438\",\n\t\"name\": \"urban-contaminants-project-data-for-sediment-fish-and-eggs-collected-from-chester-creek-an\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Urbanization has degraded the water quality
  and adversely impacted biological communities in the lakes and streams of Anchorage.
  Pollution from point and nonpoint sources have contaminated the streams with fecal
  coliform bacteria, metals, organics and petroleum products in 1991, an Urban Contaminants
  Project was initiated to monitor wildlife use, water quality and sediment contamination
  in the five major creeks of the Anchorage basin. The study is designed to sample
  one stream a year with follow-up monitoring to occur once every five years. The
  potential chronic effects of poor water quality and stream degradation to fish and
  wildlife are evaluated using field observations, chemical analysis of sediment and
  tissues, and bioassays using water and sediment. The first year's effort was designed
  to scope the study's approach, integrity and methods. Due to local pollution concerns,
  and because additional limnological and biological information exists, the first
  survey was conducted on Chester Creek. This report presents the results of chemical
  residue analysis of sediments, fish and migratory bird eggs collected from the Chester
  Creek drainage in 1991.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
